import React, { useState } from "react";
import axios from 'axios';
import { Link,useNavigate } from 'react-router-dom';
import './stilos/Create.css';

function Create() {
    const [values, setValues] = useState({
        Name: '',
        LastName: '',
        Email: '',
        password: '',
        Age: '',
        Telf: '',
    });

    const navigate = useNavigate();

    const handleChange = (e) => {
        setValues({
            ...values,
            [e.target.name]: e.target.value,
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        axios.post('/Registrarse', values)
            .then((res) => {
                navigate('/');
                console.log(res);
            })
            .catch((err) => console.log(err));
    };

    return (
        <div className="containerxd">
            <div className="row">
                <div className="col-md-8 offset-md-2">
                    <div className="form-container">
                        <h2 className="text-center mb-4">Crear Cuenta</h2>
                        <div className='d-flex justify-content-start'>
                            <Link to='/' class='btn btn-success'>Inicio</Link>
                        </div>
                        <form onSubmit={handleSubmit}>
                            <div className="mb-3">
                                <label htmlFor="nombre" className="form-label">Nombre</label>
                                <input type="text" className="form-control" id="nombre" name="Name" required onChange={handleChange} />
                            </div>
                            <div className="mb-3">
                                <label htmlFor="apellido" className="form-label">Apellido</label>
                                <input type="text" className="form-control" id="apellido" name="LastName" required onChange={handleChange} />
                            </div>
                            <div className="mb-3">
                                <label htmlFor="correo" className="form-label">Correo electrónico</label>
                                <input type="email" className="form-control" id="correo" name="Email" required onChange={handleChange} />
                            </div>
                            <div className="mb-3">
                                <label htmlFor="contrasenia" className="form-label">Contraseña</label>
                                <input type="password" className="form-control" id="contrasenia" name="password" required onChange={handleChange} />
                            </div>
                            <div className="mb-3">
                                <label htmlFor="edad" className="form-label">Edad</label>
                                <input type="number" className="form-control" id="edad" name="Age" required onChange={handleChange} />
                            </div>
                            <div className="mb-3">
                                <label htmlFor="telefono" className="form-label">Teléfono</label>
                                <input type="tel" className="form-control" id="telefono" name="Telf" required onChange={handleChange} />
                            </div>
                            <div className="d-grid gap-2">
                                <button type="submit" className="btn btn-primary">Crear Cuenta</button>
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Create;
